import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { Card, Button, Container, Row, Col } from "react-bootstrap";

function VehicleList() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/vehicles")
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error("Error fetching vehicle data:", error);
      });
  }, []);

  return (
    <Container>
      <h1 className="my-4">Vehicle List</h1>
      <Row>
        {vehicles.length > 0 ? (
          vehicles.map((vehicle) => (
            <Col key={vehicle._id} md={4} className="mb-4">
              <Card>
                <Card.Img variant="top" src={vehicle.imageUrl} alt={vehicle.name} />
                <Card.Body>
                  <Card.Title>{vehicle.name}</Card.Title>
                  <Card.Text>
                    <strong>Brand:</strong> {vehicle.brand} <br />
                    <strong>Price:</strong> â‚¹{vehicle.price} <br />
                    <strong>Fuel Type:</strong> {vehicle.fuelType}
                  </Card.Text>
                  <Link to={`/vehicles/${vehicle._id}`}>
                    <Button variant="primary">View Details</Button>
                  </Link>
                </Card.Body>
              </Card>
            </Col>
          ))
        ) : (
          <p>No vehicles found.</p>
        )}
      </Row>
    </Container>
  );
}

export default VehicleList;
